/*
 * Configuration des routes de l'application.
 * Utilise React Router pour gérer la navigation entre les différentes vues.
 * Importe les composants nécessaires, y compris PrivateLayout pour le routage privé.
 * Utilise AuthContextProvider pour gérer l'authentification dans l'application.
 */

import './App.css';
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Login from './components/Login';
import Register from './components/Register';
import PrivateLayout from './components/PrivateLayout';
import Dashboard from './components/Dashboard';
import Admin from './components/Admin';
import Books from './components/books/Books';
import BookDetail from './components/books/BookDetail';
import AddBook from './components/books/AddBook';
import EditBook from './components/books/EditBook';
import Loans from './components/loans/Loans';
import LoanDetail from './components/loans/LoanDetail';
import EditLoan from './components/loans/EditLoan';
import AddLoan from './components/loans/AddLoan';
import User from './components/User';
import Profile from './components/Profile';
import EditProfile from './components/EditProfile';
import { AuthContextProvider } from './contexts/AuthContext';
import PrivateRoute from './components/PrivateRoute';

function App() {
  return (
    <AuthContextProvider>
      <Router>
        <Routes>
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />
          <Route path="/" element={<Login />} />
          <Route element={<PrivateLayout />}>
            <Route path="/dashboard" element={<PrivateRoute element={Dashboard} />} />
            <Route path="/admin" element={<PrivateRoute element={Admin} />} />
            <Route path="/books" element={<PrivateRoute element={Books} />} />
            <Route path="/books/:id" element={<PrivateRoute element={BookDetail} />} />
            <Route path="/books/add" element={<PrivateRoute element={AddBook} />} />
            <Route path="/edit-book/:id" element={<PrivateRoute element={EditBook} />} />
            <Route path="/loans" element={<PrivateRoute element={Loans} />} />
            <Route path="/loans/:id" element={<PrivateRoute element={LoanDetail} />} />
            <Route path="/add-loan/:userId/:bookId" element={<PrivateRoute element={AddLoan} />} />
            <Route path="/edit-loan/:id" element={<PrivateRoute element={EditLoan} />} />
            <Route path="/users" element={<PrivateRoute element={User} />} />
            <Route path="/profile" element={<PrivateRoute element={Profile} />} />
            <Route path="/edit-profile/:userId" element={<PrivateRoute element={EditProfile} />} />
          </Route>
        </Routes>
      </Router>
    </AuthContextProvider>
  );
}

export default App;
